import React from "react";
import Nav from "./Nav";

const Header = () => {
  return (
    <header className="header">
      <div className="header-logo">
        <img src="./" alt="Logo of Little Lemon" />
        <img src="./littlelemon-capstone/littlelemon-capstone/imgs/littlelemonlogo.png" />
        ;
      </div>
      <Nav />
    </header>
  );
};

export default Header;
